ipcmd="dig +short $args"
url="$(eval $cmd)"
host="$(eval $ipcmd)"

useragentlist(){
usragnt=$(cat useragent.cfg)
IFS=$'\n'
useragent=( ${usragnt} )
userandom=()
function checkArray
{
 for item in ${userandom[@]}
 do
 [[ "$item" == "$1" ]] && return 0
 done
 return 1
}
while [ "${#userandom[@]}" -ne "${#useragent[@]}" ]
do
 rand=$[ $RANDOM % ${#useragent[@]} ] 
 checkArray "${useragent[$rand]}" || userandom=(${userandom[@]} "${useragent[$rand]}")
done

echo "${userandom[1]}"
}
anonymousing() {
if [[ $(systemctl status tor | grep "Active: active") ]]; then
echo "<font color=\"limegreen\">დაცულია</font>"
else
echo "<font color=\"red\">დაუცველია</font>"
fi
}
