function iprange() {
args=$(cat target)
ipcmd="dig +short $args"
host="$(eval $ipcmd)"
iprangeres() {
args=$(cat target)
ipcmd="dig +short $args"
host="$(eval $ipcmd)"
if [[ $host =~ ^([0-9]{1,2}|1[0-9][0-9]|2[0-4][0-9]|25[0-5])\.([0-9]{1,2}|1[0-9][0-9]|2[0-4][0-9]|25[0-5])\.([0-9]{1,2}|1[0-9][0-9]|2[0-4][0-9]|25[0-5])\.([0-9]{1,2}|1[0-9][0-9]|2[0-4][0-9]|25[0-5])$ ]]; then for i in {1..254} ;do (ping ${BASH_REMATCH[1]}.${BASH_REMATCH[2]}.${BASH_REMATCH[3]}.$i -c 1 -w 5  >/dev/null && echo "${BASH_REMATCH[1]}.${BASH_REMATCH[2]}.${BASH_REMATCH[3]}.$i" | sed 's/ /<br>/g'& ) ;done; else     echo "დიაპაზონს ვერ დაასკანირებთ სანამ აიპ მისამართს არ დაამატებთ!"; fi
